<!DOCTYPE html>
<html lang="en">
<head>
    <style>
        .custom{
            margin-top:50px;
            width:100%;
            padding:10px;
        }
        .custom-table{
            width:75%;
            font-size:16px;
            margin:auto;
            text-align:center;
        }
        .custom-drop{
            text-align:center;
        }
    </style>
    <style>
        thead>tr>td {
            font-weight: bold;
        }
        tbody>tr>td {
            font-weight: bold;
        }

        input[type=number]::-webkit-inner-spin-button,
        input[type=number]::-webkit-outer-spin-button {
            opacity: 1;
        }

        /* Center the loader  */
        #loader {
            position: absolute;
            left: 50%;
            top: 50%;
            z-index: 1;
            width: 150px;
            height: 150px;
            margin: -75px 0 0 -75px;
            border: 16px solid #f3f3f3;
            border-radius: 50%;
            border-top: 16px solid #34B4DB;
            width: 120px;
            height: 120px;
            -webkit-animation: spin 2s linear infinite;
            animation: spin 2s linear infinite;
        }

        @-webkit-keyframes spin {
            0% {
                -webkit-transform: rotate(0deg);
            }
            100% {
                -webkit-transform: rotate(360deg);
            }
        }

        @keyframes spin {
            0% {
                transform: rotate(0deg);
            }
            100% {
                transform: rotate(360deg);
            }
        }
        /* Add animation to "page content" */

        .animate-bottom {
            position: relative;
            -webkit-animation-name: animatebottom;
            -webkit-animation-duration: 1s;
            animation-name: animatebottom;
            animation-duration: 1s
        }

        @-webkit-keyframes animatebottom {
            from {
                bottom: -100px;
                opacity: 0
            }
            to {
                bottom: 0px;
                opacity: 1
            }
        }

        @keyframes animatebottom {
            from {
                bottom: -100px;
                opacity: 0
            }
            to {
                bottom: 0;
                opacity: 1
            }
        }

        #printing {

            text-align: center;
        }
    </style>
</head>

    //res.setHeader('Access-Control-Allow-Origin', '*');
    function startImporting() {

    var dataValues = [];
    //USER_ORGUNIT_CHILDREN
    //var indicatorUrl = "../api/analytics/dataValueSet.json?dimension=dx:PFRK0hsXRDS&dimension=pe:THIS_YEAR&dimension=ou:USER_ORGUNIT&showHierarchy=false&hierarchyMeta=false&includeMetadataDetails=true&includeNumDen=true&skipRounding=false&aggregationType=LAST&completedOnly=false";
	
	var indicatorUrl = "../api/analytics/dataValueSet.json?dimension=dx:PFRK0hsXRDS&dimension=pe:THIS_YEAR&dimension=ou:USER_ORGUNIT_CHILDREN&showHierarchy=false&hierarchyMeta=false&includeMetadataDetails=true&includeNumDen=true&skipRounding=false&aggregationType=LAST&completedOnly=false";
	
    $.ajax({

        type: "GET",
        url:  indicatorUrl,
        async: false,
        contentType: "application/json" ,
        crossDomain: true,

        success: function ( apiResponse )
        {
            alert( apiResponse.dataValues.length );

            console.log( apiResponse.dataValues.length );
            for (var i = 0; i < apiResponse.dataValues.length; i++) {
				var dataValue = {};
				if(apiResponse.dataValues[i].value != null){
					dataValue.period = apiResponse.dataValues[i].period;
					dataValue.dataElement = dataElementMap[ apiResponse.dataValues[i].dataElement +":" +  apiResponse.dataValues[i].orgUnit ];
					dataValue.categoryOptionCombo = "kdsirVNKdhm";
					dataValue.orgUnit = apiResponse.dataValues[i].orgUnit;
					dataValue.value = apiResponse.dataValues[i].value;
					dataValue.comment = apiResponse.dataValues[i].comment;
					dataValues.push(dataValue);
				}           
            }
        },
        error: function (apiResponse)
        {
            console.log( "Error" );
            //unLockScreen();
            $('#loader').hide();
			/*
            document.getElementById('resultDiv').style.display = 'block';
            document.getElementById('importPeriod').style.display = 'block';
            document.getElementById('importButton').style.display = 'block';
            document.getElementById("importButton").disabled = false;
            document.getElementById("importMsg").innerHTML = "";
            document.getElementById("importMsg").innerHTML += "<br>";
            document.getElementById("importMsg").innerHTML += "Error in API.";
			*/
			
        }
    });

    console.log(" final dataValues : " + JSON.stringify(dataValues));

    var dataValueSet = {};
    dataValueSet.dataValues = dataValues;
    console.log(" final dataValueSet : " + dataValueSet );
    console.log(" final dataValueSet : " + JSON.stringify(dataValueSet));
    //importData( dataValueSet, selectedPeriod, regOrgUnitList );
	
    if(dataValueSet.dataValues.length != 0){
	
	var dataJSON = JSON.stringify(dataValueSet);
        $.ajax({
            async: false,
            type: "POST",
            dataType: "json",
            contentType: "application/json",
            url: '../api/dataValueSets/',
            data: dataJSON,
            success: function (response) {
                console.log("response : " + response);
                console.log("response : " + response.conflicts);

                impCount = response.importCount.imported;
                upCount = response.importCount.updated;
                igCount = response.importCount.ignored;
                conflictsDetails   = response.conflicts;

            },
            error: function (response) {
                console.log("Error in post");
            }
        });
    }
	
    $('#loader').hide();

  }
